          "#000000",    // 4: RESERVED
          "#000000",    // 5: WALL
          "#000000",    // 6: RESERVED
          "#000000",    // 7: RESERVED
          "#00FF00",    // 8: HEAL
          "#FF0000",    // 9: FLAG
